func TestClient_GetBlockByHash(t *testing.T) {
	api := httptest.NewServer(http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
		var rpcReq jsonrpc.RPCRequest[any]
		decoder := json.NewDecoder(r.Body)

		if err := decoder.Decode(&rpcReq); err != nil {
			assert.NoError(t, err)
		}

		assert.Equal(t, "eth_getBlockByHash", rpcReq.Method)

		w.Header().Set("Content-Type", "application/json")
		w.WriteHeader(http.StatusOK)
		_, _ = w.Write([]byte(blockResponse))
	}))
	defer api.Close()

	client := evm.NewClient(configs.EvmRPC{URL: api.URL})

	ctx := t.Context()

	r, err := client.GetBlockByHash(ctx, "0xa2330de84ec75919db70f4b33e658cb1a9fa34557ad0082c7db87f075c96d6d2")
	fmt.Printf("%+v\n", r)
	require.NoError(t, err)

	result, ok := r.(*data.Block)
	require.True(t, ok)

	assert.Equal(t, entities.BlockHash("0xa2330de84ec75919db70f4b33e658cb1a9fa34557ad0082c7db87f075c96d6d2"), result.Hash)
	assert.Equal(t, "0x1520654", result.Number.String())
	assert.Equal(t, uint64(22152788), result.Number.Uint64())
}

